import React from 'react';
import Data from "./Data";
import Card from './Card';
function App(){
    const Da=Data.map((el)=>
        <Card img={el.img}
        title={el.title}
        review={el.review}
        des={el.des}
        price={el.price}
        />
    )
    return(
        <div style={{display:'flex',alignItems:"center "}}>{Da}</div>
    )

}
export default App
